    [],nt"num_tags": 3,nt"name": "high-temperature-liners-for-broadband-noise-reduction-project",nt"isopen":
    true,nt"url": null,nt"notes": "Core noise will become a larger component
    of engine noise overall, as more efficient design trends of fan and jet noise reduction
    technologies are implemented. The necessity to keep weight and material costs low,
    as well as the complex geometry and high temperatures involved with the combustion
    region, make the production of acoustic liners a difficult task.  CRG will develop
    and produce a prototype acoustic liner test sample for the combustion region that
    will address all of these issues.  CRG will use its Sialyte(TM) material and simple
    manufacturing processes to produce a lightweight, inexpensive liner, that contains
    inherent high-temperature resistant properties.  Sialyte(TM) is a low-cost material
    system developed for use in high-temperature and high-pressure applications.  CRG
    will tailor Sialyte(TM) liner properties to demonstrate fabrication control of Sialyte(TM)
    open-cell foams or combination with Sialyte(TM) honeycomb. These materials will
    provide broadband acoustic attenuation in relevant frequency ranges, as well as
    tailoring material properties for mechanical and thermal performance requirements.
     The Sialyte(TM) liner will conform to complex, curved geometries and will withstand
    the high temperatures and stresses in the combustion region.  CRG will demonstrate
    performance of TRL 4 in Phase I.",nt"owner_org": "d8a6202b-c0c3-463d-88a0-3bc021a178ed",nt"extras":
